import React from 'react';

import './App.css';

function App() {
  const [date, setDate] = useState(null);
  useEffect(() => {
    async function getDate() {
      const res = await fetch('/api/date');
      const newDate = await res.text();
      setDate(newDate);
    }
    getDate();
  }, []);
  return (
    <main>
      <h2>James 1st Deployed Web Page </h2>
      <button>Give me the money!</button>


    </main>
  );
}

export default App;
